import React, { useState, useEffect } from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        getCorona(); //LOL

    }, []);

    function getCorona() {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(latest => {
                const sick = latest.data;

                setData(sick)
            })
    }

    return (
    <div>
        <h1>CORONA</h1>
    </div>
    );
}

export default App;
